import React, {Component} from 'react';
import { NavLink, Route } from "react-router-dom";
import UserProfile from './UserProfile';
import UserTests from "./UserTests";
import {Redirect} from "react-router";
import styled from 'styled-components';

const AllDiv = styled.div`
	margin-top: 30px;
	font-size: 16px;
    padding-bottom: 10px;
   
`;
const LinkDiv = styled(NavLink)`
    display: inline-block;
    padding-bottom: 5px;
    color: #201C16; 
    text-decoration: none;
    box-sizing: border-box;
	:hover, :active {
		border-bottom: 1px solid #201C16;
    }
    box-sizing: border-box;
`;
const Main = styled.div`
    margin: auto;
    max-width: 1200px;
    color: rgba(16, 5, 41, 1);
    overflow: auto;
`;
const FlexRow = styled.div`
	display: flex;
	flex-direction: ${props => props.dir || 'row'};
	flex-wrap: wrap;
	padding: 30px 16px;
	width: ${props => props.width || '100%'};
	height: ${props => props.height || '100%'};
	box-sizing: border-box;

	@media screen and (max-width: 1190px) {
		flex-direction: column;
		min-width: 100%;
	}
`;
const FlexChild = styled.div`
	width:  ${props => props.width || '25%'};
	box-sizing: border-box;
		   
	@media screen and (max-width: 1190px) {
		margin: 5px;
		min-width: 100%;
	}
`;

const TestTitle = styled.div`
    font-size: 34px;
    color: #4F9DA6;
`;
const Title = styled.div`
    width: 100%;
    margin-top: 76px;
    margin-bottom: 30px;
    font-size: ${props => props.size || '34px'};  
    font-weight: bold;
    color:rgba(79, 157, 166, 1);
    border-bottom: 1px solid rgba(220, 220, 220, 1);
`;
const Score = styled.div`
    width: 100%;
    padding-bottom: 30px;
    margin-bottom: 30px;
    border-bottom: 1px solid #DCDCDC;
    font-size: 48px;
    color: #4F9DA6;
    box-sizing: border-box;

    @media screen and (max-width: 1190px) {
		margin: 5px;
		min-width: 100%;
	}
`;
const FinishedText = styled.div`
    width: 100%;
    font-size: 24px;
    text-align: center;
`;
const RouterLink = styled.span`
	color: #4F9DA6;
	text-decoration: underline;
`;


export default class StartTest extends Component {
	constructor(props){
		super(props)
	}
	render(){
		return(
            <>
            <Main>
            <AllDiv>
                <LinkDiv to={`/profile`}> My Account </LinkDiv> 
                    /{' '}
                Start tests 
            </AllDiv>
            <Title>Start Test</ Title>
            
               
            <FlexRow>
                <FlexChild width={'146px'}>
                    Logo
                </FlexChild>
                <FlexChild width={'calc(100% - 354px)'}>
                   <TestTitle>JS Foundation</TestTitle>
                  
                </FlexChild>
                <FlexChild width={'100%'}>
                    
                </FlexChild>
            </FlexRow>
        </Main>
        </>
        );
	}
}
